import React from 'react';
import Header from './elements/header';
export default function Home() {

    const isLoggedIn = document.cookie.includes('isLoggedIn=true');
    return (
        <div>
            <Header />
            <div className="home-container">
                <h1>Home</h1>
                <p>Home page content</p>
            </div>
        </div>
    );
}
